package applicationsfx.exel;import javafx.application.Application;import javafx.fxml.FXMLLoader;import javafx.scene.Parent;import javafx.scene.Scene;import javafx.stage.Stage;public class TestLaba2Main extends Application{    public static void main(String[] args) {        launch(args);    }    @Override    public void start(Stage primaryStage) throws Exception {        Parent root = FXMLLoader.load(getClass().getResource("tableView.fxml"));        primaryStage.setTitle("TestLaba2");        primaryStage.setScene(new Scene(root));        primaryStage.show();    }}